import React from 'react';
import Login from './components/login';
import Notepad from './components/notepad';
import './App.css';
import { 
  Router,
  Routes,
  Route, 
} from 'react-router-dom';

export default function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route>
            < Login />
          </Route>
          <Route>
            < Notepad />
          </Route>
        </Routes>
      </div>
    </Router>

  );
}
